script: |
  super -f text -I q331.spq | sort > q331.out

inputs:
  - name: q331.spq
    data: |
      SELECT col0 - + + ( + col0 ) FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col0 NOT BETWEEN ( - ( + CAST ( + - col1 AS INTEGER ) ) * - col1 ) AND ( NULL );
  - name: tab2

outputs:
  - name: q331.out
    data: |
